    false,nt"url": null,nt"notes": "The Digital Geologic Map of Congaree National
    Park and Vicinity, South Carolina is composed of GIS data layers complete with ArcMap
    9.3 layer (.LYR) files, two ancillary GIS tables, a Map PDF document with ancillary
    map text, figures and tables, a FGDC metadata record and a 9.3 ArcMap (.MXD) Document
    that displays the digital map in 9.3 ArcGIS. The data were completed as a component
    of the Geologic Resources Inventory (GRI) program, a National Park Service (NPS)
    Inventory and Monitoring (I&M) funded program that is administered by the NPS Geologic
    Resources Division (GRD). Source geologic maps and data used to complete this GRI
    digital dataset were provided by the following: South Carolina Geological Survey.
    Detailed information concerning the sources used and their contribution the GRI
    product are listed in the Source Citation sections(s) of this metadata record (cong_metadata.txt;
    available at http://nrdata.nps.gov/cong/nrdata/geology/gis/cong_metadata.xml). All
    GIS and ancillary tables were produced as per the NPS GRI Geology-GIS Geodatabase
    Data Model v. 2.1. (available at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm).
    The GIS data is available as a 9.3 personal geodatabase (cong_geology.mdb), and
    as shapefile (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83,
    UTM Zone 17N. The data is within the area of interest of Congaree National Park.",nt"license_title":
